const Catalog = () =>{
    return (
        <div class="grid grid-cols-12 gap-1 px-1 lg:px-10 mt-14">
          <div class="lg:col-span-6 col-span-9 p-2 lg:p-4">TITLE</div>
          <div class="col-span-1 p-4 hidden lg:block ">TIME</div>
          <div class="col-span-1 p-4 hidden lg:block ">BPM</div>
          <div class="col-span-2 p-4  hidden lg:block ">TAGS</div>
          <div class="col-span-1 p-4 hidden lg:block ">Share</div>
          <div class="lg:col-span-1 col-span-3 lg:p-4 p-2">Buy</div>
        </div>
    )
}

export default Catalog
